records.addlTxt:
Defendant Andrew J Brinsko in court, in custody, with attorney Nicole M Masnica.   Lucas Paul Bennewitz appeared for the State of Wisconsin.

Plea Colloquy.

Defendant enters a guilty plea to Count 2.  Court finds defendant guilty.  Count 3 is dismissed and read in.    Repeater Penalty enhancer struck by Court upon motion of the State.

The Court Orders the Following:

Imposed and Stayed Sentence of:

44 months Imprisonment 
- 20 months of Initial Confinement
- 24 months of Extended Supervision

Term of Probation: 3 Years

Conditions of Probation:
- AODA Assessment and follow through with any treatment recommended;
- No Use or Possession of illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Perform  20 hours of community service each year of probation with the last 20 hours of commnunity service to be completed by the 10th month of the last year;
- Obtain a valid licence within 60 days;
- Operate a Motor Vehicle with a Valid Drivers License;
- Maintain/Obtain full time employment;
- No contact with codefendant and victims or their residence.
- Provide DNA sample if not yet provided  and pay surcharge

Restitution: $500.00 joint and several with co-defendant  (to be paid at the rate of $50.00 per month commencing 11-1-15)

Costs: $278.00 
DNA Surcharge:  $250.00
(To be paid as a condition of probation at the rate of $50.00  per month commencing 8-1-15)

Condition Time: 59 days Jail (Credit - 59 days)  TIME SERVED

Defendant is not eligible for the Challenge Incarceration Program
Defendant is not eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
